import React from 'react';
export default class ColorSelector extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      colors: ['black', 'blue', 'green'],
    };
  }

  render() {
    return (
      <table>
        <tbody>
          <tr>
            {this.state.colors.map((color, index) => (
              <td
                key={index}
                style={{ backgroundColor: color, width: '5px', height: '5px' }}
              >
                {color}
              </td>
            ))}
            <td></td>
          </tr>
        </tbody>
      </table>
    );
  }
}
